import Logo from './pictures/logo3.png';

function App() {
  return (
    <div>
      <header className="flex w-full bg-rd p-2">
        <div className='mx-4'>
        <img src={Logo} alt="" className="w-10 h-10 " />
        </div>
        <form action=''>
          <input type="text" className="bg-gray-800 h-8"/>
        </form>
      </header>
    </div>
  );
}

export default App;
